import { Link } from "react-router-dom";
import Header from "../../components/header";
import './ChatPage.css';

const ChatPage = () => {

	return (
		<div>
			<Header />
				<h1>Chat page</h1>
				<br></br>
				<Link to="/home">Home</Link>
				<br></br>
		</div>
	);
};

export default ChatPage;
